import './DisplayBlog.css'

const DisplayBlog = (props) => {
    return (
        <div className="Wrapper">
            <div> Name = {props.nameprop}</div>
            <div>City = {props.cityprop}</div>
            <div>Blog = {props.blogprop}</div>
        </div>
    )
}

export default DisplayBlog;
